import styled from "styled-components";

const ImgContainer = styled.div`
    position:relative;
    width:250px;
    height:250x;
    background-color:red;
`;

const Image = styled.img`
    position:absolute;
    top:0;
    left:0;
    width:100%;
    height:100%;
`;


function AnimalControl({item}) {
  return (
      <ImgContainer>
        <Image src={item.Image}/>
      </ImgContainer>
  )
}

export default AnimalControl;
